import React, { useEffect, useState } from 'react'
import { GetAdmin, delAdmin } from './ApiAdmin/ApiAd'
import Button from 'react-bootstrap/Button';
import Table from 'react-bootstrap/Table';
function AdminList() {

  const [AAllData, setAAllData] = useState([])
  useEffect(() => {
    const DispA = async () => {
      const AlldatAA = await GetAdmin()
      console.log("All admin dataGet all------", AlldatAA);
      setAAllData(AlldatAA.data)
    }
    DispA()

  }, [])


  const delA = (id) => {
    console.log("id--",id);
    delAdmin(id)
    
    window.location.reload()
}



  return (
    <div>
      <div>
        <div className='iha'>
          <Link></Link>
          <Button variant='warning'>Back</Button>
        </div>
        <div className='outer'>
          <Table striped variant='dark'>
            <thead>
              <tr>
                <th>AdminName</th>
                <th>AdminEmail Id</th>
                <th>Age</th>
                <th>Address</th>
                <th>Delete</th>
              </tr>
            </thead>
            <tbody>
              {
                AAllData.map((add) => (
                  <tr>
                    <td style={{ color: "red" }}>{add.username}</td>
                    <td>{add.email}</td>
                    <td>{add.age}</td>
                    <td>{add.address}</td>
                    <td> <Button variant='danger' onClick={() => delA(add._id)}>Delete</Button></td>

                  </tr>
                ))
              }


            </tbody>
          </Table>
        </div>
      </div>


    </div>
  )
}

export default AdminList
